import React from "react";
import "./unitWorkspace.scss";

const unitWorkspace = ({ workspaceUrl }) => {
	return (
		<div className="workspace">
			<img
				className="workspace-logo"
				src="./img/worker.png"
				alt="worker-icon"
			/>
			<a
				className="workspace-link workspace-link--active"
				target="_blank"
				rel="noopener noreferrer"
				href={workspaceUrl}
			>
				Unit Workspace
            </a>
		</div>
	);
};

export default unitWorkspace;
